import React from 'react';
import Scroll from "./components/scroll/scroll";
import './App.css';
import bg from "./contact.png";

function App() {
  return (
    <div className="App">
    <div style={{
      backgroundSize: 'cover',
      backgroundImage: 'url(${bg})'}}>
              </div>
      <Scroll/>

    </div>
  );
}

export default App;
